Unlike many syntheses of QDs, such as electrode deposition35, photocatalytic reduction36, and sol-gel method37, our study uses a novel technique to fabricate CuxO QDs via successive ionic layer adsorption and reaction (SILAR) method38. SILAR is a simple fabrication methodology that combines successive layer adsorption with chemical redox reaction. The typical process involves successively immersing the TiO2 materials in Cu(NH3)42+\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
