				\begin{document}$${\text{Cu}(\text{NH}}_{3}{)}_{4}^{2+}$$\end{document} and H2O2 aqueous solutions successively for as many cycles as desired to achieve a uniform deposition of CuxO QDs. Not only is the overall process environmentally friendly, cost-effective, and can be carried out in normal atmospheric pressure and room temperature, but the density of QDs can also be easily controlled by merely varying the number of deposition cycles.

